import React, { useEffect, useState } from "react";
import axios from "axios";

function Form() {
    const [data, setData] = useState([]);
    useEffect(() => {
        axios.get('http://localhost:19006/form')
        .then(res => setData(res.data))
        .catch(err => console.log(err));
    },[])
  return (
    <div>
        <div>
            <table>
                <tbody>
                    <tr>
                        <th>Hoolni ner</th>
                        <th>Une</th>
                        <th>description</th>
                        <th>image</th>
                        <th>type</th>
                    </tr>
                </tbody>
            </table>
        </div>

    </div>
  )
}

export default Form
